import React from "react";
import "./layout.css";

const LevelLayout = ({ title, style }) => {
  return (
    <div>
      <div className="container">
        <h1 style={{ backgroundColor: { style } }}>{title}</h1>
      </div>
      {/* <div className="content">{children}</div> */}
    </div>
  );
};

export default LevelLayout;
